import React from 'react';
import './App.css';

function App() {
  const tourPlaces = [
    {
      name: 'Tunisia',
      image: 'https://www.planetware.com/wpimages/2020/02/tunisia-in-pictures-beautiful-places-to-photograph-sidi-bou-said.jpg',
    },
    {
      name: 'Turkey',
      image: 'https://www.albawaba.net/sites/default/files/styles/d08_standard/public/im_new/noor.ahmad/%D8%B4%D8%A7%D8%B1%D8%B9%20%D8%A7%D9%84%D8%B9%D8%B1%D8%A8%20%D9%81%D9%8A%20%D8%A7%D8%B3%D8%B7%D9%86%D8%A8%D9%88%D9%84.jpg?h=c9f93661&itok=eFYlAdIM',
    },
    {
      name: 'Spain',
      image: 'https://imgproxy.natucate.com/wF8RACmH64YN4YV3BSgRXmhB7LtrW2eBW-xf6wRpJmQ/rs:fill/aHR0cHM6Ly93d3cubmF0dWNhdGUuY29tL21lZGlhL3BhZ2VzL3JlaXNlemllbGUvNDI4YTYzZWUtMmYzOS00YmFjLTgwY2UtNmY2N2Y4Yzc1NzJlL2MxNDJhZjc3MWUtMTY3OTQ4Njc1MC9zcGFuaWVuLWxhZW5kZXJpbmZvcm1hdGlvbmVuLXN0YWR0LW96ZWFuLXdhc3Nlci1uYXR1Y2F0ZS5qcGc',
    },
  ];

  return (
    <div>
      <div className="header">
        <h1>Tour Places</h1>
      </div>
      <div className="places-container">
        {tourPlaces.map((place, index) => (
          <div className="place" key={index}>
            <h2>{place.name}</h2>
            <img src={place.image} style={{ width: '300px', height: '250px', borderRadius: '12px' }} alt={place.name} />
            <br />
            <br />
            <a href="#">Book Now</a>
          </div>
        ))}
      </div>
      <div className="footer">
        <a href="#">Copyright</a>
      </div>
    </div>
  );
}

export default App;
